class _CupertinoIconState extends State<CupertinoIcon> {
  Future<SystemImageData> systemImage;

  @override
  void initState() {
    super.initState();
    systemImage = SystemImage.load(widget.iconName, size: widget.size);
  }

  @override
  void didUpdateWidget(covariant CupertinoIcon oldWidget) {
    super.didUpdateWidget(oldWidget);
    // Only the size actually affects the image data itself. Ignore the rest.
    if (oldWidget?.size != widget.size) {
      systemImage = SystemImage.load(widget.iconName, size: widget.size);
    }
  }

  @override
  Widget build(BuildContext context) {
    return FutureBuilder<SystemImageData>(
      future: systemImage,
      builder: (BuildContext context, AsyncSnapshot<SystemImageData> snapshot) {
        if (snapshot.hasError) {
          print('failed');
          final IconData fallbackIcon =
              CupertinoIcon.fallbackMapping.containsKey(widget.iconName) ?
                  CupertinoIcon.fallbackMapping[widget.iconName] :
                  CupertinoIcons.question_circled;
          return Icon(
            fallbackIcon,
            size: widget.size,
            color: widget.color ?? CupertinoTheme.of(context).primaryColor,
          );
        }
        if (!snapshot.hasData) {
          print('no data');
          return SizedBox(height: widget.size, width: widget.size);
        }
        print('has data');
        return Image(
          height: widget.size,
          width: widget.size,
          color: CupertinoTheme.of(context).primaryColor,
          image: MemoryImage(snapshot.data.data, scale: snapshot.data.scale),
        );
      },
    );
  }
}
